import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with domcontentloaded to avoid timeout
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and type to trigger autocomplete
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');

    // Wait for autocomplete suggestions to appear
    await page.waitForSelector('.suggestion-item', { timeout: 5000 });

    // Take screenshot of autocomplete results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_autocomplete.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_autocomplete.png'));

    // Extract autocomplete suggestions
    const suggestions = await page.$$eval('.suggestion-item', items => 
      items.map(item => item.textContent.trim())
    );

    return {
      success: true,
      action: "Tested search autocomplete functionality by typing 'iPhone' and capturing suggestions",
      extractedData: {
        searchQuery: "iPhone",
        suggestions: suggestions,
        suggestionCount: suggestions.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test search autocomplete",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
